    [],nt"num_tags": 10,nt"name": "potomac-river-national-wildlife-refuge-complex-annual-narrative-report-1993-1997",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Potomac
    River National Wildlife Refuge Complex outlines Refuge accomplishments during the
    1993-1997 calendar years. The report begins with a summary of the years' highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses management planning, public participation, and research
    and investigations. Refuge administration is outlined; information about personnel,
    youth programs, volunteer programs, funding, safety, and technical assistance is
    given. Habitat management is also covered; subjects include wetlands, forests, grasslands,
    fire management, and pest control. The wildlife section of the report discusses
    endangered and threatened species, waterfowl, marsh birds and waterbirds, game mammals,
    and marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, wildlife observation,
    and law enforcement. The equipment and facilities section of the report provides
    information about rehabilitation, major maintenance, equipment replacement, and
    computer systems. Cooperative programs and items of interest are provided at the
    end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
